INSERT INTO `articles` (`id`, `name`, `content`, `excerpt`, `attachment`, `created`, `modified`) VALUES
(7, 'Festa no Maracanã marca lançamento do Talentos Senac 2015', '<p>Na &uacute;ltima quarta-feira, dia 8 de junho, o Maracan&atilde; foi palco da festa de lan&ccedil;amento do Talentos Senac 2015, competi&ccedil;&atilde;o de educa&ccedil;&atilde;o profissional que estimula a prepara&ccedil;&atilde;o dos alunos da institui&ccedil;&atilde;o para a inser&ccedil;&atilde;o no mercado de trabalho. O campe&atilde;o ol&iacute;mpico e ex-jogador de v&ocirc;lei Nalbert falou sobre suas experi&ecirc;ncias em diversas competi&ccedil;&otilde;es, desafios, momentos de supera&ccedil;&atilde;o e motiva&ccedil;&atilde;o para cerca de 450 presentes, entre diretores e gerentes da institui&ccedil;&atilde;o e seus coordenadores de curso.</p>\r\n\r\n<p>Os presentes na festa ser&atilde;o os&nbsp;respons&aacute;veis pela motiva&ccedil;&atilde;o dos alunos durante os quatro meses&nbsp;da competi&ccedil;&atilde;o que come&ccedil;a&nbsp;em agosto e tem expectativa de participa&ccedil;&atilde;o de cerca de 30 mil alunos. Na primeira fase, 30 mil alunos far&atilde;o provas escritas&nbsp;baseadas em&nbsp;estudo de casos em 25 ocupa&ccedil;&otilde;es diferentes nas 39 unidades do Senac RJ no estado. Os melhores colocados disputar&atilde;o a etapa regional, que acontecer&aacute; em setembro, com pr&aacute;ticas, elaboradas a partir dos desafios do cotidiano do trabalho de cada ocupa&ccedil;&atilde;o. A grande final ocorrer&aacute; em novembro, com cerca 18 finalistas de cada curso e a participa&ccedil;&atilde;o de jurados renomados no mercado de trabalho e empresas parceiras.</p>\r\n\r\n<p>O&nbsp;Senac RJ&nbsp;&eacute; uma institui&ccedil;&atilde;o de ensino que atua h&aacute; 69 anos na profissionaliza&ccedil;&atilde;o de pessoas para setor de com&eacute;rcio de bens, servi&ccedil;os e turismo no Estado do Rio. Atualmente, &eacute; refer&ecirc;ncia na oferta de cursos&nbsp;de educa&ccedil;&atilde;o profissional e tecnol&oacute;gica, tendo atingido a marca de 77% de empregabilidade nos &uacute;ltimos anos, e investe fortemente em inclus&atilde;o social por meio de capacita&ccedil;&atilde;o para o mercado de trabalho. Com 39 unidades em todo o estado do Rio, de 2010 a&nbsp;2013 o Senac RJ passou de 13 mil para 81 mil alunos.</p>\r\n', 'Na última quarta-feira, dia 8 de junho, o Maracanã foi palco da festa de lançamento do Talentos Senac 2015, competição de educação profissional que estimula a preparação dos alunos da instituição para a inserção no mercado de trabalho.', '', '2015-07-10 19:33:35', '2015-07-10 19:33:35'),
(8, 'TESTE', '<p>TESTANDO TESTANDO</p>\r\n', 'TESTANDO', '', '2015-07-24 20:04:26', '2015-07-24 20:04:26'),
(9, 'Teste 2', '<p>fche ufaocegfA XDPi eiod JEFJCG IHERUGCUAEHFX UIIgec fyasbxfdoAICecd</p>\r\n', 'jrch fegfygeyXGFYzaydguHUDHuefhuegXUFwyegfohw bxeofjhsFHa', '', '2015-08-25 21:18:04', '2015-08-25 21:18:04');
