(1, 'Foi dada a largada para o Talentos Senac, hoje, no Maracanã, com a presença do atleta Nalbert', '<p><em>Cerca de 30 mil alunos participar&atilde;o da competi&ccedil;&atilde;o de educa&ccedil;&atilde;o profissional que premiar&aacute; os mais talentosos em 25 ocupa&ccedil;&otilde;es</em></p>\r\n\r\n<p>Foi lan&ccedil;ada hoje (8), com um evento no Maracan&atilde;, a nova edi&ccedil;&atilde;o do&nbsp;<strong>Talentos Senac 2015</strong>, competi&ccedil;&atilde;o de educa&ccedil;&atilde;o profissional que visa ser mais uma etapa na prepara&ccedil;&atilde;o dos alunos da institui&ccedil;&atilde;o para sua inser&ccedil;&atilde;o no mercado de trabalho. O evento contou com o campe&atilde;o ol&iacute;mpico, Nalbert, que falou sobre suas experi&ecirc;ncias em diversas competi&ccedil;&otilde;es, desafios, momentos de supera&ccedil;&atilde;o e motiva&ccedil;&atilde;o. Al&eacute;m do atleta, estiveram presentes cerca de 450 convidados,&nbsp;entre diretores e gerentes da institui&ccedil;&atilde;o e seus coordenadores de curso,&nbsp;&nbsp;respons&aacute;veis pela motiva&ccedil;&atilde;o dos alunos durante os quatro meses&nbsp;da competi&ccedil;&atilde;o&nbsp;que come&ccedil;a&nbsp;em agosto.</p>\r\n\r\n<p>Na primeira fase, 30 mil alunos far&atilde;o provas escritas&nbsp;baseadas em&nbsp;estudo de casos em 25 ocupa&ccedil;&otilde;es diferentes nas 39 unidades do Senac RJ no estado. Os melhores colocados disputar&atilde;o a etapa regional, que acontecer&aacute; em setembro, com pr&aacute;ticas, elaboradas a partir dos desafios do cotidiano do trabalho de cada ocupa&ccedil;&atilde;o. A grande final ocorrer&aacute; em novembro, com cerca 18 finalistas de cada curso e a participa&ccedil;&atilde;o de jurados renomados no mercado de trabalho e empresas parceiras.</p>\r\n\r\n<p>O&nbsp;<strong>Senac RJ</strong>&nbsp;&eacute; uma institui&ccedil;&atilde;o de ensino que atua h&aacute; 69 anos na profissionaliza&ccedil;&atilde;o de pessoas para setor de com&eacute;rcio de bens, servi&cc