INSERT INTO `documents` (`id`, `name`, `content`, `content_2`, `date`, `hour`, `unity`, `material`, `created`, `modified`) VALUES
(3, 'APRENDIZAGEM EM SERVIÇOS ADMINISTRATIVOS', '<p>O profissional que atua nesta &aacute;rea Realiza atividades de apoio administrativo nas diversas &aacute;reas da empresa. Recepciona e atende clientes. Trata de documentos variados, cumprindo o procedimento administrativo necess&aacute;rio de acordo com o setor envolvido. Colabora na organiza&ccedil;&atilde;o, confer&ecirc;ncia e distribui&ccedil;&atilde;o de materiais e documentos. &nbsp;</p>\r\n', NULL, '10/07/2015', '14:00h', '', '', '2015-07-08 15:18:08', '2015-07-09 22:23:50'),
(4, 'APRENDIZAGEM EM SERVIÇOS DE VENDAS', '<p>Atende a clientes pessoalmente e via tele atendimento. Realiza promo&ccedil;&atilde;o e venda de mercadorias, cuidando da sua exposi&ccedil;&atilde;o, auxiliando os clientes na escolha do produto, informando sobre suas qualidades e vantagens para efetiva&ccedil;&atilde;o da venda. Efetua troca e faz invent&aacute;rio de mercadorias para reposi&ccedil;&atilde;o, elaborando relat&oacute;rios de vendas, promo&ccedil;&otilde;es e pesquisa de pre&ccedil;os, trabalhando individualmente ou em equipe com seguran&ccedil;a, profissionalismo, iniciativa e presteza. Apresenta-se de forma adequada aos diferentes ambientes de trabalho e relacionam-se de forma &eacute;tica com clientes, fornecedores e parceiros.</p>\r\n', NULL, '10/07/2015', '14:00h', '', '', '2015-07-08 15:18:08', '2015-07-09 22:24:06'),
(5, 'CABELEIREIRO', 'Cabe ao profissional que atua nesta área higienizar, escovar, realizar penteados, cortar, colorir, descolorir e desondular cabelos, utilizando produtos e equipamentos adequados às técnicas de embelezamento e tratamento dos cabelos, respeitando as normas de conduta ética, critérios de higiene e imagem profissional e interagindo com outros profissionais da área.', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
(6, 'CHEF EXECUTIVO', 'O profissional que atua nesta área é interessado em trabalhar como Chef de cozinha é o responsável por criar e coordenar a realização de receitas e pratos, supervisionar equipes de trabalho na cozinha, garantindo não só a qualidade dos produtos e serviços, mas também a rentabilidade do estabelecimento. Podem atuar em restaurantes, eventos e buffets.', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
(7, 'CONFEITEIRO', 'O profissional que atua nesta área é responsável pela preparação, confecção e acondicionamento de produtos de confeitaria, levando em consideração as normas e procedimentos técnicos de higiene e manipulação de alimentos, saúde e segurança no trabalho, bem como a preservação ambiental.', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
(8, 'COSTUREIRO', 'O profissional que atua nesta área é responsável pela execução de peças simples do vestuário a partir da construção de moldes, da interpretação de desenhos de moda e de fichas técnicas.', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
(9, 'COZINHEIRO', '<p>O profissional que atua nesta &aacute;rea &eacute; respons&aacute;vel pela manipula&ccedil;&atilde;o de ingredientes, execu&ccedil;&atilde;o de receitas, processos de elabora&ccedil;&atilde;o, prepara&ccedil;&atilde;o, montagem e apresenta&ccedil;&atilde;o das produ&ccedil;&otilde;es culin&aacute;rias dos diversos setores da cozinha, levando em considera&ccedil;&atilde;o as normas e procedimentos t&eacute;cnicos de higiene e manipula&ccedil;&atilde;o de alimentos, qualidade, sa&uacute;de, seguran&ccedil;a e preserva&ccedil;&atilde;o ambiental. Organiza e supervisiona servi&ccedil;os de cozinha em hot&eacute;is, restaurantes, hospitais e outros locais de refei&ccedil;&otilde;es, observando os padr&otilde;es de qualidade do alimento.</p>\r\n', NULL, '10/07/2015', '14:00h', '', '', '2015-07-08 15:18:08', '2015-07-09 22:04:10'),
(10, 'INTRODUÇÃO A FOTOGRAFIA DIGITAL', '<p>O profissional que atua nesta &aacute;rea produz imagens a partir dos princ&iacute;pios da linguagem fotogr&aacute;fica utilizando equipamento digital e outros recursos dispon&iacute;veis.</p>\r\n', NULL, '10/07/2015', '14:00h', '', '', '2015-07-08 15:18:08', '2015-07-09 22:24:52'),
(11, 'MAQUIADOR', '<p>O profissional que atua nesta &aacute;rea fazo embelezamento dos clientes, utilizando t&eacute;cnicas e produtos cosm&eacute;ticos de maquiagem para a harmoniza&ccedil;&atilde;o da face das pessoas &agrave;s diversas ocasi&otilde;es, de acordo com normas de conduta &eacute;tica, de modo interativo com os demais profissionais da &aacute;rea da beleza.</p>\r\n', NULL, '10/07/2015', '14:00h', '', '', '2015-07-08 15:18:08', '2015-07-09 22:01:55'),
(12, 'TÉCNICO EM DESIGN DE INTERIORES', 'O profissional que atua nesta área é o profissional que concebe, desenvolve, detalha, executa e acompanha projetos de interiores residenciais e comerciais, resolvendo com criatividade e técnica problemas relacionados à funcionalidade, estética e qualidade do projeto, possibilitando às pessoas maior conforto, qualidade de vida e eficiência em suas atividades.\r\n Esses profissionais trabalham como autônomos, de forma individual ou em equipe. Podem atuar também como prestadores de serviços em escritórios de design de interiores, arquitetura e lojas de mobiliário e de decoração.\r\n', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
(13, 'TÉCNICO EM ADMINISTRAÇÃO', 'O profissional que atua nesta área planeja, controla, coordena, subsidia e executa atividades nas áreas administrativa, financeira, de produção, de recursos humanos, de marketing e de logística. Isso envolve apoio ao processo de planejamento estratégico; análise e controle de indicadores de desempenho operacional; sugestões de melhorias nos aspectos estratégicos, operacionais, da qualidade e legais; pesquisa e análise de informações destinadas a subsidiar o processo operacional e administrativo, em consonância com a missão, visão, responsabilidade social e política da organização.', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
(14, 'TÉCNICO EM CONTABILIDADE', 'O profissional que atua nesta área realiza anotações das transações financeiras da organização e examina documentos fiscais e parafiscais. Analisa a documentação contábil e elabora planos de determinação das taxas de depreciação e exaustão dos bens materiais, de amortização dos valores imateriais. Organiza, controla e arquiva os documentos relativos à atividade contábil e controla as movimentações. Registra as operações contábeis da empresa, ordenando os movimentos pelo débito e crédito.\r\nPrepara a documentação, apura haveres, direitos e obrigações legais. Essas atividades caracterizam-se pelo planejamento, operação, controle e avaliação dos processos inerentes à contabilidade e às finanças. Nesse sentido, o técnico em contabilidade executa a contabilidade geral, de custos e gerencial.\r\n', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
(15, 'TÉCNICO EM ENFERMAGEM', 'O profissional que atua nesta área desenvolve ações auxiliares de enfermagem no âmbito da promoção, proteção, recuperação e reabilitação da saúde de indivíduos e grupos, prestando os cuidados requeridos por pacientes em diferentes etapas do ciclo vital, inclusive àqueles em estado grave ou em risco de morte. Nesse sentido, cabe-lhe assistir ao Enfermeiro no planejamento, na programação, orientação e supervisão das atividades de assistência de enfermagem; na prestação de cuidados diretos de enfermagem a pacientes em estado grave; na prevenção e controle das doenças transmissíveis em geral em programas de vigilância epidemiológica; na prevenção e no controle sistemático da infecção hospitalar; na prevenção e controle sistemático de danos físicos que possam ser causados a pacientes durante a assistência de saúde. ', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
(16, 'TÉCNICO EM MASSOTERAPIA', 'O profissional que atua nesta área aplica manobras de massoterapia ocidental e de massagem\r\nOriental shiatsu para propiciar o bem estar físico, relaxamento de tensões e alívio da dor. Realiza procedimentos de massoterapia estética e desportiva. Seleciona técnicas massoterápicas indicadas às diferentes necessidades do cliente. Aplica drenagem linfática, quando indicada por prescrição médica e/ou fisioterapêutica.\r\n', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
(17, 'TÉCNICO EM LOGÍSTICA', 'O profissional que atua nesta área é responsável pelo suporte ao planejamento dos processos e operações logísticas de armazenagem, gestão de estoques, transporte e distribuição de materiais e produtos. Coordena equipes na operacionalização de todas as atividades inerentes a área, sendo também responsável pelo atendimento a clientes e implementação de normas de higiene e segurança do trabalho, assim como de procedimentos ambientais e de qualidade.', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
(18, 'TÉCNICO EM SEGURANÇA DO TRABALHO', ' O Técnico em Segurança do Trabalho é o profissional responsável pela elaboração e implementação da política de saúde e segurança no trabalho (SST) na empresa, realizando auditoria, acompanhamento e avaliação na área, identificando vetores de doenças, variáveis de acidentes, qualidade de vida e meio ambiente. Promove ações educativas de caráter prevencionistas.', NULL, '10/07/2015', '14:00h', NULL, NULL, '2015-07-08 15:18:08', '2015-07-08 15:18:22'),
