INSERT INTO `pages` (`id`, `name`, `subname`, `block_1`, `block_2`, `block_3`, `block_1_attachment`, `block_2_attachment`, `block_3_attachment`, `content`) VALUES
(1, 'Sobre o Talentos', '<p>O Senac RJ &eacute; o bra&ccedil;o de Educa&ccedil;&atilde;o da Fecom&eacute;rcio do estado do Rio de Janeiro. Mais que uma institui&ccedil;&atilde;o de ensino profissional o Senac RJ qualifica pessoas em todo o estado e transforma suas vidas. Sempre em busca da <strong>excel&ecirc;ncia</strong>, contamos com o que temos de melhor: nossos talentos.</p>\r\n\r\n<p>O Talentos Senac &eacute; <strong>a maior competi&ccedil;&atilde;o</strong><strong> de educa&ccedil;&atilde;o profissional do estado</strong>. Envolve mais de 30 mil alunos de nossas 39 unidades, colocando nossos alunos &agrave; prova, em situa&ccedil;&otilde;es similares &agrave;quelas que ele enfrenta no mercado de trabalho. Esta experi&ecirc;ncia &uacute;nica desenvolve compet&ecirc;ncias importantes para os competidores como confian&ccedil;a, criatividade, lideran&ccedil;a, comunica&ccedil;&atilde;o, tomada de decis&atilde;o, resolu&ccedil;&atilde;o de problemas e racioc&iacute;nio cr&iacute;tico.</p>\r\n\r\n<p>A cada edi&ccedil;&atilde;o mais empregadores participam do evento e buscam os melhores alunos do Senac RJ para trabalhar em suas empresas. Para estes empres&aacute;rios, a participa&ccedil;&atilde;o em uma competi&ccedil;&atilde;o dessa dimens&atilde;o &eacute; um diferencial na hora da contrata&ccedil;&atilde;o de um funcion&aacute;rio.</p>\r\n\r\n<p>Assim, o Senac RJ cumpre sua miss&atilde;o de entregar para o mercado os melhores profissionais, e consolida o Talentos Senac como um canal efetivo para a empregabilidade.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>CRONOGRAMA DA COMPETI&Ccedil;&Atilde;O:</strong></h2>\r\n\r\n<table border="0" cellpadding="0" cellspacing="0" style="width:623px">\r\n	<tbody>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p>Inscri&ccedil;&atilde;o de egressos</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>10/07 - 25/07</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p>Divulga&ccedil;&atilde;o de DT Etapa Local</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>10/jul</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Local &ndash; Alunos eleg&iacute;veis</strong></p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>10/08 - 15/08</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Local - Egressos</strong></p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>15/08</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p>Divulga&ccedil;&atilde;o de lista de aprovados para Etapa Regional&nbsp;&nbsp; /&nbsp;&nbsp; DT Etapa Regional</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>21/ago</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p>Per&iacute;odo de confirma&ccedil;&otilde;es para participa&ccedil;&atilde;o para Etapa Regional</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>24/08 - 04/09</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Regional</strong>&nbsp;- Cabe&ccedil;a de chave RESENDE / POLIT&Eacute;CNICO</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>12/set</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Regional</strong>&nbsp;- Cabe&ccedil;a de chave CAMPOS / COPACABANA</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>19/set</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Regional</strong> - Cabe&ccedil;a de chave PETR&Oacute;POLIS / NITER&Oacute;I</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>26/set</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p>Divulga&ccedil;&atilde;o de lista de aprovados para Etapa Estadual&nbsp; /&nbsp;&nbsp; DT Etapa Estadual</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>02/out</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Estadual&nbsp;</strong>- Final - Dia 1</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>06/nov</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Estadual&nbsp;</strong>- Final - Dia 2</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>07/nov</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>&Eacute; realizada na pr&oacute;pria sala de aula entre <strong>10 e 15 de Agosto</strong> <strong>de 2015</strong>. Participam todos os alunos com pelo menos 20% da carga hor&aacute;ria do curso executada, de um dos 24 (vinte e quatro) cursos (ocupa&ccedil;&otilde;es) que fazem parte do Talentos Senac 2015.</p>\r\n\r\n<p>Ex-alunos (egressos) do Senac RJ, far&atilde;o provas no dia <strong>15 de Agosto de 2015</strong>, na unidade em que concluiu o curso. Somente ex-alunos inscritos pelo site poder&atilde;o fazer a prova.</p>\r\n', '<p>&Eacute; realizada em Unidades Regionais cabe&ccedil;as de chave:</p>\r\n\r\n<ul>\r\n	<li><strong>12/09 - Resende e Polit&eacute;cnico</strong></li>\r\n	<li><strong>19/09 &ndash; Campos e Copacabana</strong></li>\r\n	<li><strong>26/09 &ndash; Petr&oacute;polis e Niter&oacute;i</strong></li>\r\n</ul>\r\n\r\n<p>Participam os 3 (tr&ecirc;s) melhores classificados na Etapa Local, de cada curso (ocupa&ccedil;&atilde;o), por unidade e que tenham confirmado a participa&ccedil;&atilde;o no site, entre os dias 24/08/2015 e 04/09/2015. Tamb&eacute;m participa um ex-aluno (egresso) melhor classificado em seu curso (ocupa&ccedil;&atilde;o) em sua unidade.</p>\r\n', '<p>Acontece na capital, em um evento especial cheio de atra&ccedil;&otilde;es, onde conheceremos os grandes vencedores. Participam os 3 (tr&ecirc;s) melhores classificados na Etapa Regional em cada cabe&ccedil;a de chave, por curso (ocupa&ccedil;&atilde;o). As datas previstas para a Grande Final do Talentos Senac 2015 s&atilde;o os dias <strong>06 e 07 de Novembro de 2015.</strong></p>\r\n', NULL, NULL, '', '<p>Poder&atilde;o participar da competi&ccedil;&atilde;o os candidatos que atenderem aos seguintes crit&eacute;rios: a. Estudantes das 25 ocupa&ccedil;&otilde;es definidas no artigo 4&ordm; do Regulamento, com matr&iacute;cula, com no m&iacute;nimo, 20% da carga hor&aacute;ria executada no curso, na data de corte, 08 de Agosto de 2015. b. Candidatos ou ex alunos que estejam se matriculando apenas para competi&ccedil;&atilde;o das 25 ocupa&ccedil;&otilde;es definidas no artigo 4&ordm;, concluintes do Senac RJ que tenham sido aprovados em todas as Unidades Curriculares do curso pretendido e que tenham conclu&iacute;do o curso no per&iacute;odo de 01 de janeiro de 2014 a 08 de Agosto de 2015.</p>\r\n'),
(2, 'Regulamento Geral', '<p>O Senac RJ &eacute; o bra&ccedil;o de Educa&ccedil;&atilde;o da Fecom&eacute;rcio do estado do Rio de Janeiro. Mais que uma institui&ccedil;&atilde;o de ensino profissional o Senac RJ qualifica pessoas em todo o estado e transforma suas vidas. Sempre em busca da <strong>excel&ecirc;ncia</strong>, contamos com o que temos de melhor: nossos talentos.</p>\r\n\r\n<p>O Talentos Senac &eacute; <strong>a maior competi&ccedil;&atilde;o</strong><strong> de educa&ccedil;&atilde;o profissional do estado</strong>. Envolve mais de 30 mil alunos de nossas 39 unidades, colocando nossos alunos &agrave; prova, em situa&ccedil;&otilde;es similares &agrave;quelas que ele enfrenta no mercado de trabalho. Esta experi&ecirc;ncia &uacute;nica desenvolve compet&ecirc;ncias importantes para os competidores como confian&ccedil;a, criatividade, lideran&ccedil;a, comunica&ccedil;&atilde;o, tomada de decis&atilde;o, resolu&ccedil;&atilde;o de problemas e racioc&iacute;nio cr&iacute;tico.</p>\r\n\r\n<p>A cada edi&ccedil;&atilde;o mais empregadores participam do evento e buscam os melhores alunos do Senac RJ para trabalhar em suas empresas. Para estes empres&aacute;rios, a participa&ccedil;&atilde;o em uma competi&ccedil;&atilde;o dessa dimens&atilde;o &eacute; um diferencial na hora da contrata&ccedil;&atilde;o de um funcion&aacute;rio.</p>\r\n\r\n<p>Assim, o Senac RJ cumpre sua miss&atilde;o de entregar para o mercado os melhores profissionais, e consolida o Talentos Senac como um canal efetivo para a empregabilidade.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2><strong>CRONOGRAMA DA COMPETI&Ccedil;&Atilde;O:</strong></h2>\r\n\r\n<table border="0" cellpadding="0" cellspacing="0" style="width:623px">\r\n	<tbody>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p>Inscri&ccedil;&atilde;o de egressos</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>10/07 - 25/07</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p>Divulga&ccedil;&atilde;o de DT Etapa Local</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>10/jul</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Local &ndash; Alunos eleg&iacute;veis</strong></p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>10/08 - 15/08</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Local - Egressos</strong></p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>15/08</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p>Divulga&ccedil;&atilde;o de lista de aprovados para Etapa Regional&nbsp;&nbsp; /&nbsp;&nbsp; DT Etapa Regional</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>21/ago</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p>Per&iacute;odo de confirma&ccedil;&otilde;es para participa&ccedil;&atilde;o para Etapa Regional</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>24/08 - 04/09</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Regional</strong>&nbsp;- Cabe&ccedil;a de chave RESENDE / POLIT&Eacute;CNICO</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>12/set</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Regional</strong>&nbsp;- Cabe&ccedil;a de chave CAMPOS / COPACABANA</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>19/set</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Regional</strong> - Cabe&ccedil;a de chave PETR&Oacute;POLIS / NITER&Oacute;I</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>26/set</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p>Divulga&ccedil;&atilde;o de lista de aprovados para Etapa Estadual&nbsp; /&nbsp;&nbsp; DT Etapa Estadual</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>02/out</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Estadual&nbsp;</strong>- Final - Dia 1</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>06/nov</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="height:20px; width:492px">\r\n			<p><strong>Etapa Estadual&nbsp;</strong>- Final - Dia 2</p>\r\n			</td>\r\n			<td style="height:20px; width:131px">\r\n			<p>07/nov</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '<p>&Eacute; realizada na pr&oacute;pria sala de aula entre <strong>10 e 15 de Agosto</strong> <strong>de 2015</strong>. Participam todos os alunos com pelo menos 20% da carga hor&aacute;ria do curso executada, de um dos 24 (vinte e quatro) cursos (ocupa&ccedil;&otilde;es) que fazem parte do Talentos Senac 2015.</p>\r\n\r\n<p>Ex-alunos (egressos) do Senac RJ, far&atilde;o provas no dia <strong>15 de Agosto de 2015</strong>, na unidade em que concluiu o curso. Somente ex-alunos inscritos pelo site poder&atilde;o fazer a prova.</p>\r\n', '<p>&Eacute; realizada em Unidades Regionais cabe&ccedil;as de chave:</p>\r\n\r\n<ul>\r\n	<li><strong>12/09 - Resende e Polit&eacute;cnico</strong></li>\r\n	<li><strong>19/09 &ndash; Campos e Copacabana</strong></li>\r\n	<li><strong>26/09 &ndash; Petr&oacute;polis e Niter&oacute;i</strong></li>\r\n</ul>\r\n\r\n<p>Participam os 3 (tr&ecirc;s) melhores classificados na Etapa Local, de cada curso (ocupa&ccedil;&atilde;o), por unidade e que tenham confirmado a participa&ccedil;&atilde;o no site, entre os dias 24/08/2015 e 04/09/2015. Tamb&eacute;m participa um ex-aluno (egresso) melhor classificado em seu curso (ocupa&ccedil;&atilde;o) em sua unidade.</p>\r\n', '<p>Acontece na capital, em um evento especial cheio de atra&ccedil;&otilde;es, onde conheceremos os grandes vencedores. Participam os 3 (tr&ecirc;s) melhores classificados na Etapa Regional em cada cabe&ccedil;a de chave, por curso (ocupa&ccedil;&atilde;o). As datas previstas para a Grande Final do Talentos Senac 2015 s&atilde;o os dias <strong>06 e 07 de Novembro de 2015.</strong></p>\r\n', 'regulamento-geral.pdf', '', '', '<p><strong>Nesta p&aacute;gina, voc&ecirc; poder&aacute; fazer o download do Regulamento Geral da Competi&ccedil;&atilde;o e tamb&eacute;m dos documentos espec&iacute;ficos de cada ocupa&ccedil;&atilde;o participante do Talentos Senac 2015.</strong></p>\r\n\r\n<p>Em 2015 o Senac RJ realizar&aacute; a 5&ordf; edi&ccedil;&atilde;o da competi&ccedil;&atilde;o Talentos SENAC, que re&uacute;ne estudantes da rede de Unidades Operativas (UO) do Senac RJ, matriculados nos cursos de Educa&ccedil;&atilde;o Profissional e Tecnol&oacute;gica de diferentes segmentos produtivos, sendo realizada por meio de provas pr&aacute;ticas.</p>\r\n\r\n<p>A competi&ccedil;&atilde;o tem uma dupla finalidade: internamente, visa avaliar o desempenho dos estudantes no seu fazer profissional e, a partir da an&aacute;lise dos resultados obtidos, promover a melhoria cont&iacute;nua dos processos de Educa&ccedil;&atilde;o Profissional desenvolvidos pelo Senac RJ, em conformidade com o referencial estrat&eacute;gico de busca da excel&ecirc;ncia. Al&eacute;m disso, sendo atividade com estreito alinhamento metodol&oacute;gico com os processos de sala de aula, o evento representa a oportunidade para a promo&ccedil;&atilde;o e dissemina&ccedil;&atilde;o das melhores pr&aacute;ticas pedag&oacute;gicas, enriquecendo e difundindo o capital de conhecimento do Senac RJ.</p>\r\n\r\n<p>Para o p&uacute;blico externo, por sua vez, o Talentos SENAC tem o objetivo de apresentar para o mercado de diferentes setores produtivos o desempenho dos seus melhores alunos matriculados ou egressos dos cursos ofertados, representando um canal efetivo para a empregabilidade.</p>\r\n');
