INSERT INTO `questions` (`id`, `name`, `answer`, `created`, `modified`) VALUES
(35, 'O que é o TALENTOS SENAC 2015?', '<p>O Talentos &eacute; a maior competi&ccedil;&atilde;o de Educa&ccedil;&atilde;o Profissional do Estado do Rio de Janeiro. Avalia compet&ecirc;ncias, colocando o aluno em situa&ccedil;&otilde;es similares &agrave;quelas encontradas no mercado de trabalho. &Eacute; uma plataforma de empregabilidade que d&aacute; a oportunidade aos alunos de mostrar ao empregador seu trabalho, colocando em pr&aacute;tica o que aprendeu no Senac RJ. Assim desenvolve compet&ecirc;ncias fundamentais ao desenvolvimento profissional.</p>\r\n', '2015-07-09 19:39:23', '2015-07-09 19:39:23'),
(36, 'POR QUE DEVO PARTICIPAR do Talentos Senac 2015?', '<p>No Talentos, todos que participam ganham. O Senac RJ acredita que n&atilde;o &eacute; s&oacute; a habilidade t&eacute;cnica que &eacute; importante para o mercado de trabalho, mas tamb&eacute;m o desenvolvimento de outras compet&ecirc;ncias comportamentais. Colocar os alunos do Senac RJ &agrave; prova, desenvolve caracter&iacute;sticas importantes nos competidores como confian&ccedil;a, criatividade, capacidade de lideran&ccedil;a, comunica&ccedil;&atilde;o, tomada de decis&atilde;o, resolu&ccedil;&atilde;o de problemas, auto desenvolvimento e racioc&iacute;nio cr&iacute;tico.<br />\r\nO Talentos &eacute; tamb&eacute;m uma importante vitrine. A cada edi&ccedil;&atilde;o mais empresas participam e buscam na competi&ccedil;&atilde;o os melhores alunos do Senac RJ para trabalharem em suas empresas. Para estas empresas, o aluno que participa do Talentos &eacute; considerado um diferenciado e tem vantagem na hora de ser selecionado para uma vaga de emprego.</p>\r\n', '2015-07-09 19:39:32', '2015-07-09 19:39:32'),
(37, 'Quais os OBJETIVOS da competição?', '<p>I. Proporcionar aos estudantes oportunidade de viv&ecirc;ncia e aplica&ccedil;&atilde;o das compet&ecirc;ncias desenvolvidas em situa&ccedil;&otilde;es de avalia&ccedil;&atilde;o, semelhantes &agrave;quelas que enfrentar&atilde;o na vida profissional;<br />\r\nII. Propiciar a troca de experi&ecirc;ncia entre estudantes, instrutores, coordenadores de curso e coordenadores educacionais de todo o estado do Rio de Janeiro.<br />\r\nIII. Promover interc&acirc;mbio entre o Senac RJ, empresas dos setores produtivos e a comunidade;<br />\r\nIV. Fortalecer o posicionamento do Senac RJ como institui&ccedil;&atilde;o de excel&ecirc;ncia em educa&ccedil;&atilde;o profissional.</p>\r\n', '2015-07-09 19:39:42', '2015-07-09 19:39:42'),
(38, 'Quais as CURSOS (ocupações) que participam do Talentos Senac 2015?', '<p>1. Aprendizagem em Servi&ccedil;os Administrativos;<br />\r\n2. Aprendizagem em Servi&ccedil;os de Vendas;<br />\r\n3. Cabeleireiro;<br />\r\n4. Camareira em Meios de Hospedagem;<br />\r\n5. Chef Executivo de Cozinha;<br />\r\n6. Confeiteiro;<br />\r\n7. Costureiro;<br />\r\n8. Cozinheiro;<br />\r\n9. Gar&ccedil;om;<br />\r\n10. Introdu&ccedil;&atilde;o &agrave; Fotografia Digital;<br />\r\n11. Maquiador;<br />\r\n12. Sommelier<br />\r\n13. T&eacute;cnico em Administra&ccedil;&atilde;o;<br />\r\n14. T&eacute;cnico em Contabilidade;<br />\r\n15. T&eacute;cnico em Design de Interiores;<br />\r\n16. T&eacute;cnico em Enfermagem;<br />\r\n17. T&eacute;cnico em Est&eacute;tica;<br />\r\n18. T&eacute;cnico em Guia de Turismo;<br />\r\n19. T&eacute;cnico em Inform&aacute;tica;<br />\r\n20. T&eacute;cnico em Log&iacute;stica;<br />\r\n21. T&eacute;cnico Nutri&ccedil;&atilde;o e Diet&eacute;tica;<br />\r\n22. T&eacute;cnico em Massoterapia;<br />\r\n23. T&eacute;cnico em Seguran&ccedil;a do Trabalho;<br />\r\n24. Web Designer.</p>\r\n', '2015-07-09 19:40:02', '2015-07-09 19:40:02'),
(39, 'QUEM PARTICIPA do Talentos Senac 2015?', '<p>Poder&atilde;o participar os estudantes que atenderem aos seguintes crit&eacute;rios:<br />\r\nI. Todos os alunos com pelo menos 20% da carga hor&aacute;ria do curso executada, de um dos 24 (vinte e quatro) cursos (ocupa&ccedil;&otilde;es) que fazem parte do Talentos Senac 2015 participam. N&atilde;o &eacute; necess&aacute;ria inscri&ccedil;&atilde;o para esta etapa. A data de corte para c&aacute;lculo de horas executadas &eacute; 08 de Agosto de 2015. Leia o regulamento com aten&ccedil;&atilde;o.<br />\r\nII. Ex-alunos (egressos) dos cursos (ocupa&ccedil;&otilde;es) definidos, concluintes do Senac RJ que tenham sido aprovados em todas as unidades curriculares do curso pretendido e que tenham conclu&iacute;do ou venham a concluir o curso no per&iacute;odo de 01 de janeiro de 2014 a 08 de agosto de 2015. Necess&aacute;ria inscri&ccedil;&atilde;o no site. Leia o regulamento com aten&ccedil;&atilde;o.</p>\r\n', '2015-07-09 19:40:10', '2015-07-09 19:40:10'),
(40, 'QUANDO acontece o Talentos Senac 2015?', '<p><strong>Etapa Local</strong><br />\r\n&Eacute; realizada na pr&oacute;pria sala de aula entre 10 e 15 de Agosto de 2015. Participam todos os alunos com pelo menos 20% da carga hor&aacute;ria do curso executada, de um dos 24 (vinte e quatro) cursos (ocupa&ccedil;&otilde;es) que fazem parte do Talentos Senac 2015.<br />\r\nEx-alunos (egressos) do Senac RJ, far&atilde;o provas no dia 15 de Agosto de 2015, na unidade em que concluiu o curso. Somente ex-alunos inscritos pelo site poder&atilde;o fazer a prova.</p>\r\n\r\n<p><br />\r\n<strong>Etapa Regional </strong>&ndash; &Eacute; realizada em Unidades Regionais cabe&ccedil;as de chave:</p>\r\n\r\n<ul>\r\n	<li>&nbsp;12/09 - Resende e Polit&eacute;cnico</li>\r\n	<li>&nbsp;19/09 &ndash; Campos e Copacabana</li>\r\n	<li>&nbsp;26/09 &ndash; Petr&oacute;polis e Niter&oacute;i</li>\r\n</ul>\r\n\r\n<p>Participam os 3 (tr&ecirc;s) melhores classificados na Etapa Local, de cada curso (ocupa&ccedil;&atilde;o), por unidade que tenham confirmado a participa&ccedil;&atilde;o no site, entre os dias 24/08/2015 e 04/09/2015. Tamb&eacute;m participa um ex-aluno (egresso) melhor classificado em seu curso (ocupa&ccedil;&atilde;o) em sua unidade.</p>\r\n\r\n<p><strong>Etapa Estadual</strong> &ndash; &Eacute; realizada na cidade do Rio de Janeiro, em um local surpresa. Participam os 3 (tr&ecirc;s) melhores classificados em cada cabe&ccedil;a de chave, por curso (ocupa&ccedil;&atilde;o), na Etapa Regional.</p>\r\n\r\n<p>As datas previstas para a Grande Final do Talentos Senac 2015 s&atilde;o os dias 06 e 07 de Novembro de 2015.</p>\r\n', '2015-07-09 19:41:14', '2015-07-09 19:41:14'),
(41, 'COMO SÃO AS PROVAS do Talentos Senac 2015?', '<p>Em todas as fases da competi&ccedil;&atilde;o as provas s&atilde;o pr&aacute;ticas. O Talentos Senac simula ambientes e situa&ccedil;&otilde;es reais de trabalho que desafiam os competidores a encontrar as melhores solu&ccedil;&otilde;es para os problemas propostos, em acordo com a metodologia do &ldquo;aprender fazendo&rdquo; e as melhores&nbsp;pr&aacute;ticas do mercado.</p>\r\n', '2015-07-09 19:41:42', '2015-07-09 19:41:42'),
(42, 'Preciso de INSCRIÇÃO para a Etapa Local do Talentos Senac 2015?', '<ul>\r\n	<li>Para a Etapa Local, N&Atilde;O &Eacute; NECESS&Aacute;RIA INSCRI&Ccedil;&Atilde;O. Todos os alunos dos 24 cursos (ocupa&ccedil;&otilde;es) que fazem parte do Talentos e atendam &agrave;s condi&ccedil;&otilde;es previstas no regulamento estar&atilde;o automaticamente participando da competi&ccedil;&atilde;o em suas pr&oacute;prias unidades.</li>\r\n	<li>Ex-alunos (egressos), que atendam &agrave;s condi&ccedil;&otilde;es especificadas no regulamento, devem fazer a inscri&ccedil;&atilde;o no site entre os dias 10 e 25 de Julho de 2015.</li>\r\n</ul>\r\n', '2015-07-09 19:42:07', '2015-07-09 19:42:07'),
(43, 'Para PASSAR PARA A ETAPA REGIONAL do Talentos Senac 2015, preciso fazer inscrição?', '<ul>\r\n	<li>Todos os alunos que obtiverem nota suficiente para participar da Etapa Regional, devem CONFIRMAR SUA PARTICIPA&Ccedil;&Atilde;O entre os dias 24/08/2015 e 04/09/2015. Mesmo que voc&ecirc; n&atilde;o esteja entre os tr&ecirc;s melhores colocados ainda tem chances de ser um dos semifinalistas da competi&ccedil;&atilde;o, em caso de desist&ecirc;ncias. Por isso &eacute; muito importante que fa&ccedil;a esta confirma&ccedil;&atilde;o.</li>\r\n	<li>Ex-alunos, n&atilde;o precisam fazer inscri&ccedil;&atilde;o para esta etapa. Basta que seja o primeiro colocado em seu curso (ocupa&ccedil;&atilde;o).</li>\r\n</ul>\r\n', '2015-07-09 19:42:26', '2015-07-09 19:42:26'),
(44, 'MENORES DE 18 ANOS podem participar do Talentos Senac 2015?', '<p>A participa&ccedil;&atilde;o de menores de 18 anos ser&aacute; permitida mediante autoriza&ccedil;&atilde;o dos respons&aacute;veis legais e assinatura do Termo de Responsabilidade, que integra o regulamento.</p>\r\n', '2015-07-09 19:42:38', '2015-07-09 19:42:38'),
(45, 'Como serão compostas BANCAS DE AVALIAÇÃO das provas?', '<p>I. Na Etapa Local: ser&aacute; composta por um avaliador (instrutor) por curso (ocupa&ccedil;&atilde;o) capacitados para tal.<br />\r\nII. Na Etapa Regional: ser&aacute; composta por dois avaliadores por curso (ocupa&ccedil;&atilde;o), entre eles: instrutores, especialistas e/ou profissionais de mercado da regi&atilde;o com significativa experi&ecirc;ncia na &aacute;rea.<br />\r\nIII. Na Etapa Estadual: ser&aacute; composta por tr&ecirc;s ou mais avaliadores por (curso) ocupa&ccedil;&atilde;o, dependendo do formato de prova: instrutores, especialistas e/ou profissionais de mercado com significativa experi&ecirc;ncia na &aacute;rea.</p>\r\n', '2015-07-09 19:43:30', '2015-07-09 19:43:30'),
(46, 'Devo levar MEUS EQUIPAMENTOS E MATERIAIS para as provas?', '<p>Cada competidor deve providenciar e transportar os materiais, equipamentos ou instrumentos que est&atilde;o listados no item &ldquo;Materiais, equipamentos e utens&iacute;lios fornecidos pelos Competidores&rdquo; do Descritivo T&eacute;cnico de cada ocupa&ccedil;&atilde;o.<br />\r\nO competidor que n&atilde;o comparecer ao local de competi&ccedil;&atilde;o munido dos materiais, equipamentos ou instrumentos sob sua responsabilidade, indicados nos Descritivos T&eacute;cnicos estar&atilde;o sujeitos &agrave; perda de pontos ou elimina&ccedil;&atilde;o, de acordo com o mesmo documento.</p>\r\n', '2015-07-09 19:43:47', '2015-07-09 19:43:47'),
(47, 'Como são definidos os CRITÉRIOS DE AVALIAÇÃO?', '<p>Os crit&eacute;rios de avalia&ccedil;&atilde;o s&atilde;o homologados pela equipe de avaliadores, antes do in&iacute;cio da competi&ccedil;&atilde;o e informados aos competidores. S&atilde;o baseados no Projeto Pedag&oacute;gico de cada curso e s&atilde;o condizentes com a metodologia Senac RJ.</p>\r\n', '2015-07-09 19:44:01', '2015-07-09 19:44:01'),
(48, 'O que acontece em caso de EMPATE?', '<p>Em casos de empate, a Banca de Avalia&ccedil;&atilde;o dever&aacute; considerar o crit&eacute;rio com maior pontua&ccedil;&atilde;o indicada no Descritivo T&eacute;cnico consecutivamente e verificar qual competidor obteve melhor desempenho nele.<br />\r\nPermanecendo o empate ap&oacute;s considerados todos os crit&eacute;rios, a Banca de Avalia&ccedil;&atilde;o dever&aacute; reportar a situa&ccedil;&atilde;o &agrave; Coordena&ccedil;&atilde;o Executiva ou Coordenador Educacional presentes no local de prova.</p>\r\n', '2015-07-09 19:44:33', '2015-07-09 19:44:33'),
(49, 'Se eu achar que MINHA AVALIAÇÃO NÃO ESTÁ CORRETA, como devo proceder?', '<p>Caso n&atilde;o concorde com a avalia&ccedil;&atilde;o durante a realiza&ccedil;&atilde;o das provas pr&aacute;ticas, voc&ecirc; deve ser imediatamente reportar &agrave; Banca de Avalia&ccedil;&atilde;o. Caso n&atilde;o haja encaminhamento adequado para a quest&atilde;o, voc&ecirc; pode solicitar a presen&ccedil;a da Coordena&ccedil;&atilde;o Executiva do Talentos Senac 2015.<br />\r\nN&atilde;o haver&aacute; altera&ccedil;&atilde;o ap&oacute;s a divulga&ccedil;&atilde;o dos resultados. Caso algum competidor queira levantar algum questionamento, deve faz&ecirc;-lo durante a execu&ccedil;&atilde;o da prova, que ser&aacute; interrompida at&eacute; que os respons&aacute;veis tomem as atitudes cab&iacute;veis.<br />\r\nHavendo algum desconforto do competidor em reportar seu questionamento &agrave; Banca de Avalia&ccedil;&atilde;o, o mesmo pode acionar os representantes da Coordena&ccedil;&atilde;o Executiva que estejam presentes nos locais de prova, para que avaliem a situa&ccedil;&atilde;o e tomem as medidas cab&iacute;veis.<br />\r\nN&atilde;o haver&aacute; revis&atilde;o dos resultados em nenhuma etapa da competi&ccedil;&atilde;o.</p>\r\n', '2015-07-09 19:44:48', '2015-07-09 19:44:48'),
(50, 'Quais os PRÊMIOS destinados aos melhores colocados?', '<p>Os competidores classificados em 1&ordm;, 2&ordm; e 3&ordm; lugares em cada ocupa&ccedil;&atilde;o, nas Etapas Regional e Estadual, receber&atilde;o medalhas (simbolizando Ouro, Prata e Bronze, respectivamente).<br />\r\nNa Etapa Estadual, os competidores classificados em 1&ordm;, 2&ordm; e 3&ordm; lugares em cada ocupa&ccedil;&atilde;o, al&eacute;m do medalhas (simbolizando Ouro, Prata e Bronze, respectivamente), ter&atilde;o direito tamb&eacute;m a um pr&ecirc;mio a ser definido pela Organiza&ccedil;&atilde;o do Evento.</p>\r\n', '2015-07-09 19:45:06', '2015-07-09 19:45:06'),
(51, 'Preciso fazer algum PAGAMENTO para participar?', '<p><strong>N&Atilde;O.</strong> A participa&ccedil;&atilde;o no Talentos Senac 2015 &eacute; TOTALMENTE GRATUITA. Todas as despesas de viagem, alimenta&ccedil;&atilde;o e hotel dos competidores s&atilde;o totalmente pagas pelo Senac RJ.</p>\r\n', '2015-07-09 19:45:19', '2015-07-09 19:45:19');
